import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, NavLink } from "react-router-dom";
import { FaBars, FaTimes, FaLinkedin, FaGithub, FaInstagram } from "react-icons/fa";
import Portfolio from "./Portfolio";
import About from "./About";
import Services from "./Services";
import Works from "./Works";
import Blog from "./Blog";
import Contact from "./Contact";

const navigationItems = [
  { name: "Home", path: "/" },
  { name: "About", path: "/about" },
  { name: "Services", path: "/services" },
  { name: "Works", path: "/works" },
  { name: "Blog", path: "/blog" },
  { name: "Contact", path: "/contact" },
];

const socialLinks = [
  { icon: <FaLinkedin size={24} />, href: "https://www.linkedin.com/in/imchiranjeevi" },
  { icon: <FaGithub size={24} />, href: "https://github.com/your-profile" }, // Update this with your actual GitHub
  { icon: <FaInstagram size={24} />, href: "https://www.instagram.com/_imchiranjeevi" },
];

export default function App() {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  const toggleMenu = () => setIsMenuOpen(!isMenuOpen);

  return (
    <Router>
      <div className="min-h-screen bg-gray-100 text-gray-900 flex flex-col md:flex-row">
        {/* Mobile Hamburger Button */}
        <button
          className="fixed top-4 left-4 z-50 md:hidden p-2 bg-white rounded-full shadow-md text-gray-700 hover:bg-gray-200 transition-colors"
          onClick={toggleMenu}
          aria-label="Toggle menu"
        >
          {isMenuOpen ? <FaTimes size={20} /> : <FaBars size={20} />}
        </button>

        {/* Sidebar */}
        <aside
          className={`fixed top-0 left-0 w-64 h-full bg-gray-800 text-white p-6 transform transition-transform duration-300 ease-in-out z-40
            ${isMenuOpen ? "translate-x-0" : "-translate-x-full"} md:translate-x-0 md:static md:flex md:flex-col md:justify-between`}
        >
          <div>
            <div className="flex items-center justify-between">
              <h1 className="text-xl font-bold tracking-tight text-white">Chiranjeevi Kumar</h1>
              <button className="md:hidden text-white" onClick={toggleMenu}>
                <FaTimes size={20} />
              </button>
            </div>
            <nav className="mt-8 space-y-3">
              {navigationItems.map((item) => (
                <NavLink
                  key={item.name}
                  to={item.path}
                  end={item.path === "/"} // Replaced 'exact' with 'end' for React Router v6
                  onClick={() => setIsMenuOpen(false)} // Close menu on link click (mobile)
                  className={({ isActive }) =>
                    `block px-3 py-2 rounded-md text-sm font-medium transition-all duration-200 ${
                      isActive
                        ? "bg-green-600 text-white"
                        : "text-gray-300 hover:bg-gray-700 hover:text-white"
                    }`
                  }
                >
                  {item.name}
                </NavLink>
              ))}
            </nav>
          </div>
          <div className="space-y-6">
            <div className="flex gap-4">
              {socialLinks.map((link, index) => (
                <a
                  key={index}
                  href={link.href}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="text-gray-400 hover:text-green-500 transition-colors duration-200"
                  aria-label={link.href.includes("linkedin") ? "LinkedIn" : link.href.includes("github") ? "GitHub" : "Instagram"}
                >
                  {link.icon}
                </a>
              ))}
            </div>
            <p className="text-gray-500 text-xs">
              Â© {new Date().getFullYear()} Chiranjeevi Kumar. All rights reserved.
            </p>
          </div>
        </aside>

        {/* Overlay for Mobile Menu */}
        {isMenuOpen && (
          <div
            className="fixed inset-0 bg-black bg-opacity-50 z-30 md:hidden"
            onClick={toggleMenu}
          />
        )}

        {/* Main Content */}
        <main className="flex-1 md:ml-64 p-4 sm:p-6 md:p-12 lg:p-16 overflow-y-auto bg-gray-50">
          <Routes>
            <Route path="/" element={<Portfolio />} />
            <Route path="/about" element={<About />} />
            <Route path="/services" element={<Services />} />
            <Route path="/works" element={<Works />} />
            <Route path="/blog" element={<Blog />} />
            <Route path="/contact" element={<Contact />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}
